function drawLineColors(n){var t=new google.visualization.DataTable,i,r;t.addColumn("number","X");t.addColumn("number","Average Student Reported Understanding");graphData.push(n);t.addRows(graphData);i={vAxis:{minValue:0,maxValue:100,title:"Level of Understanding (%)"},hAxis:{title:"Time (minutes)",textPosition:"none"},colors:["#1c91c0","#097138"],lineWidth:5,gridlines:{count:-1}};r=new google.visualization.LineChart(document.getElementById("chart_div"));r.draw(t,i)}function GetDataPoints(){jQuery.support.cors=!0;$.ajax({url:"/api/Data?id="+$("#LectureId").val(),type:"GET",dataType:"json",success:function(n){setTimeout(GetDataPoints,1e3);drawLineColors(n)},error:function(n,t){console.log(n,t)}})}google.charts.load("current",{packages:["corechart","line"]});google.charts.setOnLoadCallback(GetDataPoints);var graphData=[];